#Repost @imaginepip with @get_repost
・・・
We started Teacher Appreciation Week with PiP giving each of the 141 IIANT teachers and staff a $35 gift ($4,935) on behalf of all Imagine families. So far this week, parents have given an additional 360 gifts totaling $5,956. Combined that’s 501 gifts totaling $10,891. That’s amazing!

Remember, you have until midnight this Sunday, May 10. To join in on the gift giving for Teacher Appreciation Week through GiftCrowd, please visit https://www.giftcrowd.com/#/event/Zz89udvGp8.

@dragon_diaries
@imaginestaff
@imaginepip

