post_text:
#classof2020 #Repost @imaginepip with @get_repost
・・・
The Parents in Partnership (PiP) Legacy Student Scholarship was founded in 2016 to award modest financial gifts for college expenses to selected recipients.

PiP will proudly award $3,500 in scholarship monies to three graduating seniors in the amounts of $2,000, $1,000, and $500 again this year.

The deadline to submit applications is Friday, May 8th. The three winners will be announced after May 22nd.

For more information about the scholarship requirements and application process, visit https://www.imaginepip.org/legacy-scholarship.html

@dragon_diaries
@imaginepip
@imaginestaff

